import React from "react";
import google from "../../assets/images/google.svg";
import { useGoogleLogin } from '@react-oauth/google';  // Import useGoogleLogin hook from Google OAuth package
import axios from 'axios';  // Import axios for making API requests
import { Link, useNavigate } from 'react-router-dom';  // Import useNavigate for redirecting after login

export default function Signup() {
  const navigate = useNavigate();  // Initialize useNavigate hook for navigation

  // Setup Google login handler using the useGoogleLogin hook
  const handleGoogleLogin = useGoogleLogin({
    onSuccess: async (response) => {  // onSuccess callback when Google login is successful
      try {
        // Send the access_token to your backend API for authentication
        const res = await axios.post('/api/dj-rest-auth/google/', {
          access_token: response.access_token,
        });
        console.log(res.data);  // Log the response data (can be removed later)
        navigate('/');  // Redirect the user to the dashboard after successful login
      } catch (error) {
        console.error('Login failed:', error);  // Log any errors that occur during the login process
      }
    },
    onError: (error) => {
      console.error('Google login failed:', error);  // Log any errors if Google login fails
    },
  });

  return (
    <div className="px-4 lg:px-10 mx-auto bg-[#f4fbff]">
      <div className="shadow-box-shadow p-4 lg:p-10 max-w-4xl mx-auto rounded-[10px]">
        <div className="flex flex-col items-center w-[65%] mx-auto">
          <h2 className="pt-20 lg:pt-0 mb-6">
            <span className="text-2xl lg:text-3xl font-semibold">
              <span className="gradient font-black">Create </span> An Account
            </span>
          </h2>
          <div className="w-full flex flex-col">
            <button
              className="flex mx-auto items-center justify-center gap-4 px-4 py-4 font-medium text-xl w-72 rounded-full border"
              onClick={() => handleGoogleLogin()}
            >
              <img src={google} alt="google" /> Signup With Google
            </button>
            <p className="text-xl mx-auto">or</p>
            <div className=" p-2">
              <div className="flex gap-4 justify-center">
                <div>
                  <input type="text" placeholder="Enter First Name" className="border rounded-xl p-4" />
                </div>
                <div>
                  <input type="text" placeholder="Enter Last Name" className="border rounded-xl p-4" />
                </div>
              </div>
              <div className="flex flex-col w-full">
                <input type="text" placeholder="Enter Username" className="border rounded-xl p-4 m-3" />
                <input type="text" placeholder="Enter Email" className="border rounded-xl p-4 m-3" />
                <input type="text" placeholder="Enter Password" className="border rounded-xl p-4 m-3" />
                <input type="text" placeholder="Enter Confirm Password" className="border rounded-xl p-4 m-3" />
                <input type="text" placeholder="Enter Phone" className="border rounded-xl p-4 m-3" />
              </div>
            </div>
            <button className="gradient2 rounded-full font-bold text-white px-4 py-4 mx-auto w-72">
              Signup
            </button>
          </div>
          <h4 className="text-[#686868] font-xl m-3">
            Already Have An Account?
            <span className="gradient">
              <Link to="/signin"> Signin </Link>
            </span>
          </h4>
        </div>
      </div>
    </div>
  );
}
